Prednosti in udobje


24 ur na dan in vse dni v letu vam je na voljo celovit pregled vaših osebnih financ. Kjer koli in kadar koli lahko dostopate do svojih računov in opravljate plačila.


Osnovne prednosti


•	Dostop do spletne banke v aplikaciji prek mobilnega telefona;
•	napredno in enostavno opravljanje bančnih storitev;
•	varna in preprosta uporaba;
•	možnost vpogleda 24/7;
•	za uporabnike spletne banke MyNet hiter začetek uporabe brez obiska poslovalnice. Naročilo mobilnega žetona lahko oddate kar prek spletne banke, in sicer prek svojih naročil;
•	vstop in potrjevanje plačil ter naročil z mobilnim žetonom, s pomočjo katerega si ob aktivaciji določite osebno geslo PIN.


Mobilna aplikacija omogoča:


•	uporabo mobilnega žetona;
•	spremembo osebnega gesla PIN;
•	spremljanje stanja in prometa na transakcijskem in drugih aktivnih računih, odprtih pri banki;
•	opravljanje negotovinskih plačilnih transakcij (vnos in spremljava nalogov v domovini, čezmejno in v tretje države);
•	izvajanje plačil z uporabo funkcije Slikaj in plačaj;
•	pregled in poslovanje z direktnimi obremenitvami SEPA;
•	pregled in poslovanje z e-računi;
•	pregled in odplačevanje kreditov;
•	pregled in poslovanje z varčevalnimi računi in računi namenskega premijskega varčevanja;
•	pregled depozitov;
•	spremljanje dnevne tečajne liste;
•	informativni preračun valut;
•	pregled poslovanja s plačilnimi karticami Mastercard;
•	pošiljanje različnih zahtevkov in naročil;
•	vse druge storitve, s katerimi banka pozneje nadgradi mobilno banko.


Varnost dostopa


Varen dostop do mBanke zagotavlja varna dvofaktorska avtentikacija, ki preverja kombinacijo mobilne naprave in kode PIN.
Podatki in gesla, povezani z uporabnikovim bančnim računom, se nikoli ne hranijo na mobilni napravi, temveč na visoko varovanem strežniku.



